import React from "react";
import "./SidebarMenu.css";

function SidebarMenu() {
  return (
    <div className="SidebarMenu">
      <ul>
        <li>Home</li>
        <li>About</li>
        <li>Contact</li>
      </ul>
    </div>
  );
}

export default SidebarMenu;
